import React from 'react';
import Api from './api/Api';

export default function App() {
  return (
    <div>
      <h3>React Todos</h3>
      {fetch('http://localhost:3001/todos')
      .then((res) => {
        return res.json();
      })
      .then((json) => {
        console.log(json);
      })}
    </div>
    );
}
